'use strict';

// MODULES //

var datasets = require( '@stdlib/datasets' );


// ASSIGN //

/**
* Assigns modules to a namespace.
*
* @private
* @param {Object} ns - namespace
* @returns {Object} input namespace
*
* @example
* var ns = {};
* assign( ns );
* // ns => {...}
*/
function assign( ns ) {
	ns.datasets = datasets;
	return ns;
} // end FUNCTION assign()


// EXPORTS //

module.exports = assign;
